"use strict";new Vue({el:"#app",data:{formData:{serverAddress:"",using:!1,port:0,postmanAddress:"",emailAccount:"",password:"",nickname:""}},mounted:function(){var a=this;axios.post("/emailInfo/data_get").then(function(s){if(s.data.status){var e=JSON.parse(s.data.message);a.formData.serverAddress=e.serverAddress,a.formData.using=e.using,a.formData.port=e.port,a.formData.postmanAddress=e.postmanAddress,a.formData.emailAccount=e.emailAccount,a.formData.password=e.password,a.formData.nickname=e.nickname}})},methods:{save:function(){var a=this;axios.post("/emailInfo/data_save").then(function(s){s.data.status?a.$message({type:"success",message:s.data.message}):a.$message({type:"error",message:s.data.message})}).catch(function(s){a.$message({type:"error",message:s})})},switchChange:function(a){console.log(11),this.formData.using=a}}});